import React from 'react';
import './HeaderSub.scss';

function HeaderSub() {
  return (
    <header>
      <nav>
        <div>
          <img src="/taeyoung/images/header/instagram-brands.svg" alt="logo" />
          <span>Westargram</span>
        </div>
        <form>
          <input type="text" placeholder="검색" />
        </form>
        <div>
          <img
            src="/taeyoung/images/header/compass-regular.svg"
            alt="compass"
          />
          <img src="/taeyoung/images/header/heart-regular.svg" alt="like" />
          {/* <img src="/taeyoung/images/header/user-regular.svg" alt="user" /> */}
        </div>
      </nav>
    </header>
  );
}

export default HeaderSub;
